//SPDX-License-Identifier:MIT
pragma solidity ^0.8.3;
contract counter{
    uint public count;
    event Show(string oper, uint oge);
    function inc() public {
count +=1;
    }
    function dec() public {
        count -=1;
    }
   function emi() public {
       emit Show("grr",234);
   } 
}

